import React from 'react'

const Browse = () => {

    const [laotopList, setLaptopList] = useState(laptopData);

    const displayLaptopData =() =>{
        if(laotopList.length === 0) return <h1 className='text-center'>No Data Found</h1>

        return laotopList.map((laptop) => (<div className='col-md-8'>
            <div className='card'>
              <img src={laptop.image} alt="" />
              <div className='card-body'>
                <h4>{laptop.title}</h4>
                
              </div>
            </div>
        </div>))
    }
  return (
    <div>Browse</div>
  )
}

export default Browse
